// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.5.16;


contract TContract {
    string public stringValue = "value";
    bool public myBool = true;
    int public myInt = -1;
    uint public myUint = 1;
    uint8 public myUint8 = 1;
 
    function set(string memory _value) public {
        stringValue = _value;
    }
}
